import React from 'react';
//import TaskCard from './modules/taskcard';



class App extends React.Component {

  state = {
    todo: [{
      title: "Buy Milk",
      description: "order online on big basket"
    }, {
      title: "book",
      description: "return library book"
    },
    {
      title: "exercise",
      description: "do yoga and go on a walk"
    }, {
      title: "water",
      description: "drink 4l water everyday"
    }, {
      title: "cat",
      description: "feed the cat"
    }],
    done: []
  };

  render() {
    return (

      this.state.tasks.array.forEach(task => {
        <div className="taskcard-content" draggable="true" onDrag="ondrag()">
          <div className="title"> {task.title}</div>
          <hr></hr>
          <div className="description"> {task.description}</div>
        </div>
      })

    );
  }
}

export default App;
